import React, {Component} from 'react';


class Navbar extends Component{

    render(){

        const  { items } = this.props;

        const listItem = items.map(item => {

            return(

                <div className={'navbar'}>

                    <h1>Name: { item.name }</h1>
                    <h1>Age: { item.age }</h1>
                    <h1>Black: { item.sex}</h1>


                </div>


            )
        })


        return(

            <div className={'navbar'}>

                <h1>Name: { name }</h1>
                <h1>Age: { age }</h1>
                <h1>Black: { bilet }</h1>


            </div>

        );
    }
}

export default Navbar;
